      samount: 23,
      sdate: '12/21/22' 
  },
  {
      sname: "mohit",
      sdetails: "bat me btauga",
      samount: 23,
      sdate: '12/21/22' 
  }
]



// sdate ke sare obj aage eske under 
 const ecard = (val) => {
    return(
        <Card 
            name={val.sname}
            details={val.sdetails}
            amount={val.samount}
            date={val.sdate}
        />
    )
}



const Cards = () => {
  return (
    <>
    {Sdata.map(ecard)}
    </>
  )
}

export default Cards
